import React, { useState } from "react";
import UploadPhotos from "./UploadPhotos"; // Import the UploadPhotos component
import ImagePreview from "./ImagePreview"; // Import the ImagePreview component

const App = () => {
  const [selectedFiles, setSelectedFiles] = useState([]);

  return (
    <div>
      <UploadPhotos selectedFiles={selectedFiles} setSelectedFiles={setSelectedFiles} />
      <ImagePreview selectedFiles={selectedFiles} />
    </div>
  );
};

export default App;
